import React from 'react'
import"./EducationBox.css"
const EducationBox = ({number,percentage,year,style,ins}) => {
  return (
    <div style={{...style}} className='education'>
          <h1>{number}</h1>
         <h4 className='per'>{percentage}</h4>
         <h4>{year}</h4>
         <h4>{ins}</h4>
    </div>
  )
}

export default EducationBox
